import React from 'react';
import { Tag } from 'primereact/tag';

// import { Container } from './styles';
interface Props {
    data: any
  }
const Tags: React.FC<Props> = (props:Props) => {
  return <div> {
    props.data.map((tag: any) =>{
        return <Tag value={tag} icon="pi pi-plus"></Tag>
    })
    } </div>;
}

export default Tags;
